        </tr>

      </thead>

      <tbody>

        {data.map((info) => (

          <tr key={ info.name }>

            <td>{info.name}</td>
            <td>{info.rotation_period}</td>
            <td>{info.orbital_period}</td>
            <td>{info.diameter}</td>
            <td>{info.climate}</td>
            <td>{info.gravity}</td>
            <td>{info.terrain}</td>
            <td>{info.surface_water}</td>
            <td>{info.population}</td>
            <td>{info.residents.map((resident) => resident)}</td>
            <td>{info.films.map((film) => film)}</td>
            <td>{info.created}</td>
            <td>{info.edited}</td>

          </tr>

        ))}

      </tbody>

    </table>
  );
}

export default Table;
